              </li>
              <li>
                <Link to='/postview'>1234</Link>
              </li>
              <li>
                <Link to='/postview'>1234</Link>
              </li>
            </ul>
        </div>
        <div className='subbuttons'>
            <div class="pagination">
                <a href="#">&lt;&lt;</a>
                <a href="#">&lt;</a>
                <a class="active" href="#">1</a>
                <a href="#">2</a>
                <a href="#">3</a>
                <a href="#">4</a>
                <a href="#">5</a>
                <a href="#">6</a>
                <a href="#">&gt;</a>
                <a href="#">&gt;&gt;</a>
            </div>
            <button id="freewrite"
              onClick={() => {
                navigate('/write');
              }}
              >글쓰기</button>
        </div>
    </MainBackgorund>
  );
}

export default Freeboard;
